import (
	context "context"
	fern "github.com/required-nullable/fern"
	fernclient "github.com/required-nullable/fern/client"
)

client := fernclient.NewClient()
response, err := client.GetFoo(
	context.TODO(),
	&fern.GetFooRequest{
		RequiredBaz: "required_baz",
		RequiredNullableBaz: fern.String(
			"required_nullable_baz",
		),
	},
)

import (
	context "context"
	fern "github.com/required-nullable/fern"
	fernclient "github.com/required-nullable/fern/client"
)

client := fernclient.NewClient()
response, err := client.UpdateFoo(
	context.TODO(),
	"id",
	&fern.UpdateFooRequest{
		XIdempotencyKey: "X-Idempotency-Key",
		NullableText: fern.String(
			"nullable_text",
		),
		NullableNumber: fern.Float64(
			1.1,
		),
		NonNullableText: fern.String(
			"non_nullable_text",
		),
	},
)
